import React, {useEffect, useState} from 'react';
import MY_SERVICES  from '../../services'

function Home() {
  const [videogames, setVideogames] = useState(null)
  useEffect(()=>{
    MY_SERVICES.getVideogames()
    .then(({data})=> setVideogames(data.videogames))
    .catch(err => console.log(err))
  },[])

  console.log(videogames)
  if(!videogames)return <p>Loading..</p>

  return (
    <div className="main">
      {videogames.map((e,i)=>{
        return(
          <div className="card">
            <img src={e.image} alt="image-game" width="200px" height="100px"/>
            <p>{e.name}</p>
            <p>{e.description}</p>
            <p>{e.developer.name}</p>
            <p>{e.year}</p>

              {e.console.map((e,i)=>{
                return(   
                  <ul>   
                  <li>{e.name}</li>
                  </ul>
                  )
                }
                )}


          </div>
        )
      })}
    </div>
  );
}

export default Home;
